function add_favorite() {
  var title = document.title;
  var URL = document.URL;
  if (document.all) {
    window.external.addFavorite(URL, title);
  }
  else if (window.sidebar) {
    try {
      window.sidebar.addPanel(title, URL, '');
    }
    catch (e) {
      alert("抱歉, 您所使用的瀏覽器無法完成此操作.\n\n加入收藏失敗, 請使用Ctrl+D進行添加.");
    }
  }
}
function checkbox_onclick(s) {
  var checkbox = document.getElementById('duizhao_' + s);
  var records_array = '' != records ? records.split(',') : [];
  if (checkbox.checked && !records_array.includes(s)) {
    records_array[records_array.length] = s;
  }
  else if ((!checkbox.checked) && records_array.includes(s)) {
    records_array.splice(records_array.indexOf(s), 1);
  }
  records = '';
  for (var i = 0; i < records_array.length; ++i) {
    if (0 != i) {
      records += ',';
    }
    records += records_array[i];
  }
  set_cookie('records', records);
}
var records = get_cookie('records');
if ('' != records) {
  set_cookie('records', records);
}
var records_array = '' != records ? records.split(',') : [];
function jumpTo(anchor_id) {
  var url = location.href;
  location.href = '#' + anchor_id;
  history.replaceState(null, null, url);
}
var stroke_id = '';
function load_stroke(key, sub_key) {
  var my_div = document.getElementById('stroke_player');
  var current_id = stroke[key][sub_key];
  if (current_id != stroke_id) {
    var playerShare = new PlayerShare('https://stroke-order.learningweb.moe.edu.tw/', current_id, '0', 'zh_TW');
    playerShare.load();
    my_div.style.removeProperty('display');
    stroke_id = current_id;
    jumpTo('stroke_pos');
  }
  else {
    my_div.style['display'] = 'none';
    my_div.innerHTML = '';
    stroke_id = '';
  }
}
function close_stroke() {
  var my_div = document.getElementById('stroke_player');
  my_div.style['display'] = 'none';
  my_div.innerHTML = '';
  stroke_id = '';
}
